import { useState } from "react";
import HomePage from "./HomePage";
import AccountsPage from "./AccountsPage";
import TransactionsPage from "./TransactionsPage";
import RevenuePage from "./RevenuePage";
import ContactInfoPage from "./ContactInfoPage";
import ProfilePage from "./ProfilePage";

function NavigationBar(props) {

    const [pageInfo, setPageInfo] = useState('home');

    function page() {
        if (pageInfo == 'home') {
            return <HomePage username={props.username} />
        } else if (pageInfo == 'accounts') {
            return <AccountsPage username={props.username} />
        } else if (pageInfo == 'transaction') {
            return <TransactionsPage username={props.username} />

        } else if (pageInfo == 'budget') {

            return <RevenuePage username={props.username} />
        } else if (pageInfo == 'profile') {

            return <ProfilePage username={props.username} />
        } else {

        }
    }

    function chageTheme() {
        if (props.styles.bgColor == 'white' && props.styles.txColor == 'black') {
            props.setStyles({ bgColor: 'rgb(60, 60, 60)', txColor: 'rgb(125, 125, 125)' });
        } else {
            props.setStyles({ bgColor: 'white', txColor: 'black' });
        }
    }

    return (<>
        <nav className="navbar navbar-expand-lg bg-dark sticky-top">
            <div className="container-fluid">
                <button id="homeBtn" className="border-0 bg-dark navbar-brand" onClick={() => setPageInfo('home')}>
                    <img src="FinSyncIcon.png" id="navBrandLogo" style={{ height: '40px' }} alt="Logo" />
                    <label htmlFor="navBrandLogo" className="text-white fs-3" style={{ cursor: "pointer" }}>
                        &nbsp;FinSync
                    </label>
                </button>
                <ul className="navbar-nav ms-auto flex-row">
                    <li className="nav-item m-1">
                        <button id="contactinfoBtn" className="border-0 bg-dark nav-link" onClick={() => chageTheme()}>
                            {(props.styles.bgColor == 'white' && props.styles.txColor == 'black') ?
                                <i class="bi bi-moon-stars text-white"></i> : <i class="bi bi-sun text-white"></i>
                            }
                        </button>
                    </li>
                    <li className="nav-item m-1">
                        <button id="profileBtn" className="btn border-1 border-secondary rounded-circle bg-secondary" onClick={() => setPageInfo('profile')}>
                            {/* <img src="FinSyncIcon.png" style={{ height: '25px', width: '25px' }} alt="" /> */}
                            <i class="bi bi-person-fill text-white"></i>
                        </button>
                    </li>
                    <li className="nav-item m-1">
                        <button className="btn btn-danger" onClick={() => props.logOutUser()}>
                            Log&nbsp;Out
                        </button>
                    </li>
                </ul>
            </div>
        </nav>
        <div className="container-fluid" style={{ backgroundColor: props.styles.bgColor, color: props.styles.txColor }}>
            <div className="row">
                <div className="col-xxl-1 col-lg-2 col-md-3 col-4 text-center fs-5 p-0 p-0" style={{ backgroundColor: 'rgb(247, 247, 254)', borderRight: '2px solid rgb(232, 232, 232)' }}>
                    <nav className="navbar navbar-expand-lg p-0 mt-4 ms-2" style={{ position: 'fixed' }}>
                        <ul className="navbar-nav flex-column">
                            <li className="nav-item m-1">
                                <button id="hometBtn" className={"text-dark border-0 nav-link rounded px-2 py-1" + (pageInfo == 'home' ? " btn-primary" : " bg-transparent")} onClick={() => setPageInfo('home')}>
                                    <i class="bi bi-house-door"></i>&nbsp;Home
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button id="itemsBtn" className={"text-dark border-0 nav-link rounded px-2 py-1" + (pageInfo == 'items' ? " btn-primary" : " bg-transparent")} onClick={() => setPageInfo('items')}>
                                    <i class="bi bi-bag-dash"></i>&nbsp;Items
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button id="accountBtn" className={"text-dark border-0 nav-link rounded px-2 py-1" + (pageInfo == 'accounts' ? " btn-primary" : " bg-transparent")} onClick={() => setPageInfo('accounts')}>
                                    <i class="bi bi-bank"></i>&nbsp;Banking
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button id="transactionBtn" className={"text-dark border-0 nav-lin rounded px-2 py-1"+ (pageInfo == 'transaction' ? " btn-primary" : " bg-transparent")} onClick={() => setPageInfo('transaction')}>
                                    <i class="bi bi-send"></i>&nbsp;Transaction
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button id="budgetBtn" className={"text-dark border-0 nav-link rounded px-2 py-1"+ (pageInfo == 'budget' ? " btn-primary" : " bg-transparent")} onClick={() => setPageInfo('budget')}>
                                    <i class="bi bi-wallet2"></i>&nbsp;Budget
                                </button>
                            </li>
                        </ul>
                    </nav>
                </div>
                <div className="col-xxl-11 col-lg-10 col-md-9 col-8 p-0">
                    <div className="">
                        {page()}
                    </div>
                    <div className="">
                        <ContactInfoPage username={props.username} />
                    </div>
                </div>
            </div>

        </div>
    </>);
}

export default NavigationBar;
